import auth from '../../utils/auth'
import database from '../../core/Database/database'
import User from '../../models/User'

export default auth.authRequired(async (req, res) => {
  try {
    res.json({user: req.userId})
  } catch (e) {
    res.status(500).json({ error: e })
  }
})
